always @(posedge tx_mac_aclk or posedge tx_reset)
begin
    if(tx_reset == 1'b1)
        tx_mac_aclk_en <= 1'b0;
    else if(aclk_en_cnt == 7'd0)
        tx_mac_aclk_en <= 1'b1;
